import { Card, Typography } from "@material-ui/core";
import React from "react";
const MyCard=()=>{
    const getCard=()=>{
        return (
            <Card>
                <Typography>This is a card</Typography>
            </Card>

        );
    };
    return getCard();
    
};
export default MyCard;
